import React from 'react';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Header from './Header'; // Importa el componente Header
import Footer from './Footer'; // Importa el componente Footer
import MainContent from './MainContent'; // Importa el componente MainContent
import Idioms from "./components/Idioms";
import Preferences from "./components/Preferences";
import AddStudent from "./components/AddStudent";
import GetAllStudents from "./components/GetAllStudents";
import './App.css'; // Importa estilos específicos de App

function App() {
  return (
    <div className="app">
      <BrowserRouter>
        <Header /> {/* Renderiza el componente Header */}
        <Routes>
          <Route path="/" element={<MainContent/>} /> {/* Renderiza el componente MainContent */}
          <Route path="/idioms" element={<Idioms/>} />
          <Route path="/preferences" element={<Preferences/>} />
          <Route path="/addStudent" element={<AddStudent/>} />
          <Route path="/getAllStudents" element={<GetAllStudents/>} />
        </Routes>
        <Footer /> {/* Renderiza el componente Footer */}
      </BrowserRouter>
    </div>
  );
}

export default App;
